  [],\n\t\"revision_timestamp\": \"2016-07-27T22:55:13.864832\",\n\t\"name\": \"browns-park-national-wildlife-refuge-annual-narrative-report-calendar-year-1985\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Browns
  Park NWR outlines Refuge accomplishments during the 1985 calendar year. The report
  begins with a summary of the year's highlights and weather conditions. Land acquisition
  is covered. The report includes a planning section which discusses management plans
  and research and investigation. Refuge administration is outlined; information about
  personnel, funding, safety, and technical assistance is given. Habitat management
  is also covered; subjects include wetlands, forests, grasslands, grazing, fire management,
  and wilderness and special areas. The wildlife section of the report discusses endangered
  and threatened species, waterfowl, marsh birds and migratory birds, game mammals,
  fisheries resources, wildlife propagation and stocking, and animal control. The
  public uses of the Refuge described in this report include interpretive programs,
  hunting,  recreational uses, and law enforcement. The equipment and facilities section
  of the report provides information about new construction, rehabilitation, major
  maintenance, equipment replacement, communication systems, and energy conservation.
  Cooperative programs and items of interest are provided at the end. Photographs
  and brochures are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
